import React, { useState, useEffect } from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { Container, Row, Col, Tab, Nav } from "react-bootstrap";
import '../../styles/styles.css';

export default function TestcaseSection(){
    let [question, setQuestion] = useState([]);

    useEffect(() => {
      fetch("http://localhost:3001/31")
        .then(res => res.json())
        .then(data => {
            setQuestion(data);
          },
          (error) => {
            setQuestion(error);
          }
        )
    }, []);

    return(
        <div class="testcase-section">
            <div class="test-title">TESTCASE</div>
            {question.map(quest => {
                const {
                testcase_input_1,
                testcase_output_1,
                testcase_input_2,
                testcase_output_2
                } = quest;
                return (
                    <Col>
                        <Row>Input: {testcase_input_1}</Row>
                        <Row>Output: {testcase_output_1}</Row>
                    </Col>
                );
            })}
            <Tab.Container class="testcase-tabs" defaultActiveKey="first">
                <Row>
                    <Col sm={3}>
                    <Nav variant="pills" className="flex-column">
                        <Nav.Item>
                        <Nav.Link eventKey="first">Testcase 1</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                        <Nav.Link eventKey="second">Testcase 2</Nav.Link>
                        </Nav.Item>
                    </Nav>
                    </Col>
                    <Col sm={9}>
                    <Tab.Content>
                        <Tab.Pane eventKey="first">
                            <p>Input: {testcase_input_1}</p>
                            <p>Output: {testcase_output_1}</p>
                        </Tab.Pane>
                        <Tab.Pane eventKey="second">
                        Sonnet
                        </Tab.Pane>
                    </Tab.Content>
                    </Col>
                </Row>
            </Tab.Container>
        </div>
    );
};
